import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import FormularioNombreApellido from "./components/Formulario";
import PantallaDestino from "./components/Pantalla";

function App() {
    return (
        <Router>
            <Routes>
                <Route path="/" element={<FormularioNombreApellido titulo="Formulario Nombre y Apellido" />} />
                <Route path="/resultado" element={<PantallaDestino />} />
            </Routes>
        </Router>
    );
}

export default App;
